window.onload=function(){var e=document.querySelector("#pro-pic-src .a-CardView-mediaImg");if(e){var t=e.getAttribute("src"),r=new Image;r.src=t,document.getElementById("pro-pic").appendChild(r)}var n=document.querySelector("#pro-pic-src .a-CardView-title");if(n){var o=n.textContent;document.getElementById("edm-name").textContent=o}var c=document.querySelector("#pro-pic-src .a-CardView-subTitle");if(c){var d=c.textContent;document.getElementById("edm-district").textContent=d}};